import React, {useState} from 'react';
import axios from "axios";
import {BaseUrl} from "../consistents";

function Login(props) {
    const [uesername, setUesername] = useState("")
    const [password, setPassword] = useState("")
    const [login_status, setLogin_status] = useState("")

    function usernameHandler(e) {
        setUesername(e.target.value)
    }

    function passwordHandler(e) {
        setPassword(e.target.value)
    }

    function login() {
        let data = JSON.stringify({
            "username": uesername,
            "password": password
        });

        let config = {
            method: 'post',
            maxBodyLength: Infinity,
            url: BaseUrl + '/auth/',
            headers: {
                'Content-Type': 'application/json'
            },
            data: data
        };

        axios.request(config)
            .then((response) => {
                console.log(JSON.stringify(response.data));
                setLogin_status("login success")
            })
            .catch((error) => {
                console.log(error);
                setLogin_status("username or password error")
            });


    }


    return (
        <div>
            <h1>Login Page</h1>
            <p>Uesername<input id={"username"} type={"text"} onChange={usernameHandler}></input></p>
            <p>password<input id={"password"} type={"text"} onChange={passwordHandler}></input></p>
            <button id={"loginbtn"}>login</button>
            <p id={"login_status"}>{{login_status}}</p>
        </div>
    );
}

export default Login;
